import { useNavigate,NavLink } from "react-router-dom";
import styles from "./styles.module.css";
import Footer from "../footer/index";

const Main = () => {
	const navigate = useNavigate();

	const handleLogout = () => {
		navigate("/")
	};

	return (
		<div className={styles.main_container}>
			<nav className={styles.navbar}>
				{/* Left Section with Logo */}
				<h1 className={styles.nav_logo}>WealthWise</h1>

				{/* Right Section with Navigation Links and Logout Button */}
				<div className={styles.nav_links_container}>
					<div className={styles.nav_links}>
						{/* Home Link */}
						<NavLink
							to="/DashBoard"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							DashBoard
						</NavLink>

						{/* Courses Link */}
						<NavLink
							to="/Income"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Income
						</NavLink>

						{/* Contact Link */}
						<NavLink
							to="/Expenses"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Expenses
						</NavLink>

						{/* About Link */}
						<NavLink
							to="/SavingInvestment"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Saving&Investment
						</NavLink>
					</div>

					{/* Logout Button */}
                    <div className="login-bar"><p className={styles.logoutBar}>|</p>
                    </div>
					<button className={styles.white_btn} onClick={handleLogout}>
                    Logout
					</button>
				</div>
			</nav>
			<form >
            <div className="input-control">
                <input 
                    type="text" 

                    name={'title'} 
                    placeholder="Salary Title"

                />
            </div>
            <div className="input-control">
                <input v 
                    type="text" 
                    name={'amount'} 
                    placeholder={'Salary Amount'}

                />
            </div>
            <div className="input-control">

            </div>
            <div className="selects input-control">
                <select required  name="category" id="category">
                    <option value=""  disabled >Select Option</option>
                    <option value="salary">Salary</option>
                    <option value="freelancing">Freelancing</option>
                    <option value="investments">Investiments</option>
                    <option value="stocks">Stocks</option>
                    <option value="bitcoin">Bitcoin</option>
                    <option value="bank">Bank Transfer</option>  
                    <option value="youtube">Youtube</option>  
                    <option value="other">Other</option>  
                </select>
            </div>
            <div className="input-control">
                <textarea name="description"  placeholder='Add A Reference' id="description" cols="30" rows="4" ></textarea>
            </div>
            <div className="submit-btn">
                <button 
                    name={'Add Income'}

                    bPad={'.8rem 1.6rem'}
                    bRad={'30px'}
                    bg={'var(--color-accent'}
                    color={'#fff'}
                />
            </div>
        </form>		
			<Footer/>
		</div>
	);
};

export default Main;
